import {
    withGoogleMap,
    withScriptjs,
    GoogleMap,
    Marker,
    InfoWindow
} from 'react-google-maps';

import React from 'react'
import { useState } from 'react'
const center = {
    lat: 28.669155,
    lng: 77.453758,
};

export const Maps = () => {


    return (
        <GoogleMap defaultCenter={center} defaultZoom={13}>
            <Marker

                position={center}
            //   onClick={() => this.handleToggleOpen()}
            >

            </Marker>
        </GoogleMap>
    )
}
